const wasmBase64 = '';

/* global WebAssembly */

import ImageData from "@canvas/image-data";

const stubs = {
  fd_close() { throw new Error('Syscall fd_close not implemented') },
  fd_seek() { throw new Error('Syscall fd_seek not implemented') },
  fd_write() { throw new Error('Syscall fd_write not implemented') }
};

function base64ToBufferSource(base64: string) {
  const binaryString = atob(base64);
  const length = binaryString.length;
  const buffer = new ArrayBuffer(length);
  const view = new Uint8Array(buffer);
  for (let i = 0; i < length; i++) {
    view[i] = binaryString.charCodeAt(i);
  }
  return buffer;
}

// const wasmModule = new WebAssembly.Module(base64ToBufferSource(wasmBase64));
// const instance = new WebAssembly.Instance(wasmModule, { wasi_snapshot_preview1: stubs });

export const ready = WebAssembly.instantiate(base64ToBufferSource(wasmBase64), { wasi_snapshot_preview1: stubs });
export async function decode(input) {
  const module = await ready;
  const instanceExports = module.instance.exports as any;

  // Allocate memory to hand over the input data to WASM
  const inputPointer = instanceExports.malloc(input.byteLength);
  const targetView = new Uint8Array(instanceExports.memory.buffer, inputPointer, input.byteLength);

  // Copy input data into WASM readable memory
  targetView.set(input);

  // Allocate metadata (width & height)
  const metadataPointer = instanceExports.malloc(8);

  // Decode input data
  const outputPointer = instanceExports.WebPDecodeRGBA(inputPointer, input.byteLength, metadataPointer, metadataPointer + 4);

  // Free the input data in WASM land
  instanceExports.free(inputPointer);

  // Guard return value for NULL pointer
  if (outputPointer === 0) {
    instanceExports.free(metadataPointer);
    throw new Error('Failed to decode WebP image');
  }

  // Read returned metadata
  const metadata = new Uint32Array(instanceExports.memory.buffer, metadataPointer, 2);
  const [width, height] = metadata;

  // Free the metadata in WASM land
  instanceExports.free(metadataPointer);

  // Create an empty buffer for the resulting data
  const outputSize = (width * height * 4);
  const output = new Uint8ClampedArray(outputSize);

  // Copy decoded data from WASM memory to JS
  output.set(new Uint8Array(instanceExports.memory.buffer, outputPointer, outputSize));

  // Free WASM copy of decoded data
  instanceExports.free(outputPointer);

  // Return decoded image as raw data
  return new ImageData(output, width, height)
}
